  switch (name) {
    case 'fireworks':
      return size === 'small' ? smallFireworks : size === 'medium' ? mediumFireworks : largeFireworks;
    case 'supernova':
      return size === 'small' ? smallNova : size === 'medium' ? mediumNova : largeNova;
    case 'glider':
      return size === 'small' ? smallGlider : size === 'medium' ? mediumGlider : largeGlider;
    case 'nitro':
      return size === 'small' ? smallNitro : size === 'medium' ? mediumNitro : largeNitro;
    case 'random':
      return size === 'small' ? Array.from({length: 225}, () => Math.round(Math.random())) : 
             size === 'medium' ? Array.from({length: 625}, () => Math.round(Math.random())) :
             Array.from({length: 1225}, () => Math.round(Math.random()));
    default:
      return smallFireworks;
  }
